define('text!components/page-tree-node.html', ['module'], function(module) { module.exports = "<template>\r\n    <li class=\"node ${isExpanded ? '' : 'collapsed'}\">\r\n        <span class=\"leaf\"><a route-href=\"route: page; params.bind: {id:page.id}\"><span class=\"${page.iconClass}\"></span> ${page.name}</a></span>\r\n        <span if.bind=\"page.hasChildren\" class=\"node-toggle\" click.trigger=\"toggle()\"></span>\r\n        <ul if.bind=\"page.hasChildren\">\r\n            <page-tree-node repeat.for=\"child of children\" page.bind=\"child\"></page-tree-node>\r\n        </ul>\r\n    </li>\r\n</template>"; });
